export default function GetIssues({ page}) {
    const apiUrl = `http://localhost:3000/issues?page=${page}`;

    console.log("hola")
    return fetch(apiUrl)
      .then(res => res.json())
      .then(res => {
        const { data} = res
        if (Array.isArray(data.results)) {
          console.log(data)
          return data.results;
        }
      })
      .catch((error) => {
        console.error(error);
      })
}
